import React, { Component } from 'react';

//Components

//CSS
import "./Ticket.css";

class Ticket extends Component {
  render() {
    return (
      <div className="Ticket">
        <div className="color">
          <h1 className="title">Turnos</h1>
        </div>
      </div>
    );
  }
}

export default Ticket;
